import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {Home} from "./Home";
import {About} from "./About";
import {FAQ} from "./FAQ";

class Meat extends Component{
    constructor(props) {
        super(props);
        this.state = {
            meat_content: this.props.meat_content
        };
    }

    render() {
        let meat;
        if(this.state.meat_content === "home"){
            meat = <Home/>;
        }
        else if(this.state.meat_content === "about"){
            meat = <About/>;
        }
        else if(this.state.meat_content === "faq"){
            meat = <FAQ/>;
        }
        return(
            meat
        );
    }
}

export {Meat};
